Storyline

&quot;Executions&quot; is a documentary showing real footage of the many different methods humanity has used through-out history for capital punishment. During the film, the makers point out how unjustifiable the death penalty is in every situation, so they do take a staunch stance against what they're presenting. Footage from live executions are shown in detail

